import {CREATE_USER, SIGN_UP_USER} from "../action-types";

const INITIAL_STATE = {

};

const signUpReducer = (state=INITIAL_STATE, action)=>{
    switch (action.type) {
        case SIGN_UP_USER:
            return{
                ...state,
                [action.payload.id]:action.payload
            };
        default:
            return state;
    }

};

export default signUpReducer;
